import React from 'react'
import FooterLink from './FooterLink'

class Footer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }
    }

    render() {
        return (
            <React.Fragment>
                <nav className="layout-footer footer bg-footer-theme bg-dark" style={{ bottom:0 }}>
                    <ul className="nav nav-tabs tabs-alt0 border-transparent">
                        <li className="nav-item">
                            <FooterLink path="/careers" name="careers" />
                        </li>
                        <li className="nav-item">
                            <FooterLink path="/faq" name="faq" />
                        </li>
                        <li className="nav-item">
                            <FooterLink path="/contactus" name="contactUs" />
                        </li>
                        <li className="nav-item">
                            <FooterLink path="/privacypolicy" name="privacyPolicy" />
                        </li>
                        <li className="nav-item">
                            <FooterLink path="/terms" name="terms" />
                        </li>
                    </ul>
                </nav>
            </React.Fragment>
        )
    }
}

export default Footer
